import React from "react";
import { Box, Typography, Link, Divider } from "@mui/material";

const Header = () => {
  return (
    <Box
      sx={{
        // height: "100vh",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        width: "100%",
        backgroundColor: 'black'
      }}
      align='center'
    >
      <Typography variant="h3" my={2}>Classificador de Fake News</Typography>
      <Divider />
        <Typography variant="h6">
          <strong>Como Funciona?</strong>
        </Typography>
        <Typography variant="article">
            Copie o texto completo da notícia, cole no campo abaixo e clique em "Enviar".
        </Typography>
        <Typography variant="article">
            Nosso sistema irá processar o texto e classificar a possibilidade da notícia ser falsa.
        </Typography>
    </Box>
  );
};

export default Header;
